fields.description:
Прочные, легкие, технологичные и отзывчивые A-10 - это высокопроизводительная машина, сочетающая в себе все самые передовые технологии компании Ride и предназначенная для покорения самых крутых склонов и нетронутой снежной целины.

Особенности конструкции:
- Алюминиевая база линейки A-Series;
- Карбоновый хайбэк Carbon Slimeback™ с вставкой из уретана для гашения вибраций и максимального контроля;
- Трехкомпонентный пяточный стрэп, сконструированный из пены с внутренней стороны и 2-х видов пластика разной плотности - с внешней, - для комфортной надёжной фиксации пятки, долговечности и отзывчивости;
- Минималистичный носочный стрэп с патентованной накладкой для максимального прилегания к носку ботинка;
- Футбэд с углом наклона 2,5° для естественной постановки стопы и специальными амортизационными вставками;
- Алюминиевые и пластиковые диски в комплекте на все случаи жизни;
- Алюминиевые клипсы Linkage, обеспечивающие максимально возможную плавность хода и высокий уровень сцепки с гребенкой
